import React from 'react';
import { makeStyles } from '@material-ui/core/styles';
import Modal from '@material-ui/core/Modal';
import Backdrop from '@material-ui/core/Backdrop';
import Fade from '@material-ui/core/Fade';
import Button from '@material-ui/core/Button';
import TextField from '@material-ui/core/TextField';

const useStyles = makeStyles((theme) => ({
	modal: {
		display: 'flex',
		alignItems: 'center',
		justifyContent: 'center',
	},
}));

export const CreatRecharge = () => {
	const classes = useStyles();
	const [open, setOpen] = React.useState(false);

	const handleOpen = () => {
		setOpen(true);
	};

	const handleClose = () => {
		setOpen(false);
	};

	return (
		<div className='PacketNew_button'>
			<div onClick={handleOpen}>
				<button className='button_add'>TẠO MỚI GÓI NẠP</button>
			</div>
			<Modal
				aria-labelledby='transition-modal-title'
				aria-describedby='transition-modal-description'
				className={classes.modal}
				open={open}
				onClose={handleClose}
				closeAfterTransition
				BackdropComponent={Backdrop}
				BackdropProps={{
					timeout: 500,
				}}
			>
				<Fade in={open}>
					<div>
						<div className='PacketNew_wrapper'>
							<div className='title'>
								<h3>TẠO MỚI GÓI NẠP</h3>
							</div>
							<div className='PacketNew_content'>
								<form className='PacketNew__form'>
									<div className='code-Packet'>
										<span>Mã Gói:</span>
										<span>
											<strong>01</strong>
										</span>
									</div>
									<div className='PacketNew__form--file'>
										<TextField id='standard-name' label='Tên  gói' name='code' />
										<TextField id='standard-name' label='Phí' name='fees' />
										<TextField id='standard-name' label='Khuyến mại' name='discount' />
										<TextField id='standard-name' label='Thời hạn sử dụng' name='date' />
									</div>
									<div className='PacketNew__form--button'>
										<Button variant='outlined' onClick={handleClose}>
											Hủy bỏ
										</Button>
										<Button variant='outlined' type='submit' value='Submit'>
											Tạo mới
										</Button>
									</div>
								</form>
							</div>
						</div>
					</div>
				</Fade>
			</Modal>
		</div>
	);
};
